CREATE OR REPLACE VIEW tna.insp_networkreference
AS SELECT adt.gml_id AS property_gml_id,
    adt.typ AS propertytyp,
    adn.typ AS elementtyp,
    adn.gml_identifier AS element_href
   FROM tna.insp_aerodromenode adn
     JOIN tna.insp_aerodrometype adt ON adn.typ::text = adt.typ::text
UNION
 SELECT adc.gml_id AS property_gml_id,
    adc.origin AS propertytyp,
    adn.origin AS elementtyp,
    adn.gml_identifier AS element_href
   FROM tna.insp_aerodromenode adn
     JOIN tna.insp_aerodromecategory adc ON adn.origin::text = adc.origin::text
UNION
 SELECT coaf.gml_id AS property_gml_id,
    coaf.condition AS propertytyp,
    adn.condition AS elementtyp,
    adn.gml_identifier AS element_href
   FROM tna.insp_aerodromenode adn
     JOIN tna.insp_conditionofairfacility coaf ON adn.condition::text = coaf.condition::text
UNION
 SELECT coaf.gml_id AS property_gml_id,
    coaf.condition AS propertytyp,
    rwya.condition AS elementtyp,
    rwya.gml_identifier AS element_href
   FROM tna.insp_runwayarea rwya
     JOIN tna.insp_conditionofairfacility coaf ON rwya.condition::text = coaf.condition::text;


CREATE OR REPLACE VIEW tna.insp_transportnetwork
AS WITH tn_elements AS (
         SELECT insp_aerodromenode.gml_identifier AS element_href
           FROM tna.insp_aerodromenode
        UNION
         SELECT insp_airspacearea.gml_identifier AS element_href
           FROM tna.insp_airspacearea
        UNION
         SELECT insp_designatedpoint.gml_identifier AS element_href
           FROM tna.insp_designatedpoint
        UNION
         SELECT insp_runwayarea.gml_identifier AS element_href
           FROM tna.insp_runwayarea
        UNION
         SELECT insp_navaids.gml_identifier AS element_href
           FROM tna.insp_navaids
        ), acg_fea AS (
         SELECT insp_tn_air_acg_features.insp_fea_pk,
            insp_tn_air_acg_features.featuretype,
            insp_tn_air_acg_features.statename,
            insp_tn_air_acg_features.geodatenstelle,
            insp_tn_air_acg_features.ds_md_fileidentifier,
            insp_tn_air_acg_features.annex_theme,
            insp_tn_air_acg_features.namespace_base,
            insp_tn_air_acg_features.gml_identifier_codespace,
            insp_tn_air_acg_features.inspireid_namespace,
            insp_tn_air_acg_features.metadataproperty,
            insp_tn_air_acg_features.ftype_guid_link,
            insp_tn_air_acg_features.innetwork_guid_link
           FROM tna.insp_tn_air_acg_features
          WHERE insp_tn_air_acg_features.featuretype::text = 'TransportNetwork'::text
        )
 SELECT acg_fea.statename,
    acg_fea.geodatenstelle,
    acg_fea.ds_md_fileidentifier,
    acg_fea.annex_theme,
    acg_fea.featuretype,
    (((acg_fea.annex_theme::text || '.'::text) || acg_fea.featuretype::text) || '.'::text) || '1'::text AS localid,
    acg_fea.namespace_base,
    acg_fea.gml_identifier_codespace,
    (((((((((acg_fea.statename::text || '.'::text) || acg_fea.geodatenstelle::text) || '.'::text) || acg_fea.ds_md_fileidentifier::text) || '.'::text) || acg_fea.annex_theme::text) || '.'::text) || acg_fea.featuretype::text) || '.'::text) || '1'::text AS gml_id,
    (acg_fea.ftype_guid_link::text || '.'::text) || '1'::text AS gml_identifier,
    acg_fea.inspireid_namespace,
    '1996-01-01T00:00:00'::text AS beginlifespanversion,
    'FIR Wien'::text AS geographicname,
    tn_elements.element_href,
    'air'::text AS typeoftransport
   FROM tn_elements,
    acg_fea;

