,('AT','0012','6bed1778-d6bf-11e8-9f8b-f2801f1b9fd1','tn-a','AirspaceArea','tn-a.AirspaceArea.104','https://inspire.austrocontrol.at','http://inspire.jrc.ec.europa.eu/ids','AT.0012.6bed1778-d6bf-11e8-9f8b-f2801f1b9fd1.tn-a.AirspaceArea.104','2019-11-11','https://inspire.austrocontrol.at/AT.0012.6bed1778-d6bf-11e8-9f8b-f2801f1b9fd1','https://inspire.austrocontrol.at/AT.0012.243b6e36-d14a-11e8-a8d5-f2801f1b9fd1/tn.TransportNetwork.1','https://inspire.austrocontrol.at/AT.0012.6bed1778-d6bf-11e8-9f8b-f2801f1b9fd1/tn-a.AirspaceArea.104','AT.0012.6bed1778-d6bf-11e8-9f8b-f2801f1b9fd1.tn-a.AirspaceArea.104.GEOM','https://inspire.austrocontrol.at/AT.0012.6bed1778-d6bf-11e8-9f8b-f2801f1b9fd1/','2019-11-11T00:00:00',104,'R','LOR15',NULL,'Wien','H24','CIVIL',0,'FT','AGL',NULL,NULL,NULL,10000,'FT','AMSL',NULL,NULL,NULL,NULL,'1) Entry, exit, transit of as well as operation within Restricted Area Wien permitted only:\Na) for operational flights (§ 145 aviation act), for ambulance or rescue flights or for flights used in case of disaster, or\Nb) with aircraft operating in accordance with "§ 2 Abs. 1 lit. c des Wehrgesetzes 2001" BGBl. I Nr. 146/2001 in the last valid version, or\Nc) for IFR flights approaching the airport Wien-Schwechat in direction east or south, or\Nd) in individual cases, when clearance is granted by ATS unit (§ 3 of the "Rules of the Air") for safety reasons and especially also for purpose of flight calibration or flight check of air traffic service facilities, or\Ne) by clearance of the appropriate ATC unit from 0600 until 2100 local time with aircraft,\Nea) operating for military reasons, or\Neb) departing from or landing at an aerodrome within LO R 15 Wien as far as necessary for the purpose of departing or landing, or\Nec) flying between the right Donau bank and the furthest embankment on the left Donau bank, or\Nf) with permission of the responsible authority from 06.00 until 21.00 local time with aircraft operating for purposes which are not only for private interests of a person and which otherwise couldn''t be reached (especially aerial photographs and measuring flights). The permission may only be granted if no serious noise abatement reasons or other public interests - in particular the interest in air safety - exist. In that case the restricted area Wien shall be crossed on the shortest possible flight path if the height is below 6000FT above ground excluding flights written under item d.\N2) Operation of unmanned aircraft class 1 (§ 24f LFG) is permitted only with authorisation by the appropriate authority.\N3) If weather conditions and traffic situation permit and there are no reasons against flight safety the landing at airport Wien-Schwechat has to be executed in direction west, in direction north respectively.\N4) Within Restricted Area Wien VFR flights are permitted only in accordance with the prescribed procedure in respect to flight safety and noise abatement.\N5) Within Restricted Area Wien aircraft executing an instrument approach to airport Wien-Schwechat and which are already in approach direction to the aerodrome should be operated in a regular descent, as far as no other ATC-clearance was granted or something other is necessary to ensure safety of operation of the aircraft.
